import './styles.css';
//import banner from './banner.jpeg';
import Header from './Header.js';
import Circle from './blackcircle.png';

function App() {
  return (
    <div>
        <Header/>
        <div className = "h-20 bg-cover" style={{backgroundImage:'url("https://images.unsplash.com/photo-1457369804613-52c61a468e7d?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=3870&q=80")'}}>
        </div>
        <div className="bg-biome_dark-brighter">
          <div className="mx-6 relative flex">
            <div className="h-30 w-20 rounded-full overflow-hidden relative -top-3 border-4 border-white">
              <img src={Circle}/>
            </div>
            <div className="pt-2 pl-4">
              <h1 className = "text-gray-300 text-3xl">Biome: Bringing the world together</h1>
            </div>
          </div>
        </div>
    </div>
  );
}

export default App;
